#include <boost/multiprecision/cpp_int.hpp>
#include <iostream>
#include <chrono>

const int MAX_STEPS = 1 << 21;  // must be power of 2

constexpr const int BITS = 1024 * 300 + 40;
constexpr const int K = 307175;
static_assert(K < BITS);

using namespace boost::multiprecision;

// for some reason checked ints are faster?
using bigint = number<cpp_int_backend<K * 3, K * 3, signed_magnitude, checked, void>>;

// Test value, 20 bit prime with 300 256-bit primes
//const bigint n("");

const bigint n("");
const bigint m((bigint(1) << (K * 2)) / n);

bigint reduce(const bigint& x) {
    const bigint result = x - ((x * m) >> (K * 2)) * n;
    return result >= n ? result - n : result;
}

// https://en.wikipedia.org/wiki/Cycle_detection#Brent.27s_algorithm
// https://en.wikipedia.org/wiki/Pollard%27s_rho_algorithm#Algorithm
int main() {
    assert(n >> K == 0 && n >> (K - 1) > 0);

    const auto start = std::chrono::steady_clock::now();
    bigint hare = std::chrono::time_point_cast<std::chrono::seconds>(start).time_since_epoch().count();
    std::cout << "Starting hare = " << hare << std::endl;

    for (int pw = 1; (pw << 1) <= MAX_STEPS; pw <<= 1) {
        std::cerr << "pw = " << pw << ' ' << std::chrono::duration_cast<std::chrono::seconds>(std::chrono::steady_clock::now() - start) << std::endl;
        bigint tort(hare);
        bigint gcd_prod(1);
        for (int j = 1; j <= pw; ++j) {
            hare = reduce(hare * hare + 1);
            gcd_prod = reduce(gcd_prod * abs(hare - tort));
        }
        const bigint g = gcd(gcd_prod, n);
        if (g != 1) {
            std::cout << "Factor: " << g << std::endl;
        }
    }
}

